import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // The view toggle controls only appear after a search or category navigation.
    // We will perform a search to make them visible.
    await page.locator('#searchInput').fill('electronics');
    await page.locator('button.search-btn').first().click();

    // Wait for the search results and view controls to load
    await page.waitForSelector('.sort-filter-controls');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results_grid.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results_grid.png'));

    // Locate and click the "List View" button
    const listViewButton = page.getByRole('button', { name: 'List View' });
    await listViewButton.click();

    // Wait for the view to update and the product container to have the 'products-list' class
    await page.waitForSelector('.products-list');

    // Take a final screenshot showing the list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view_active.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view_active.png'));

    // Extract the class of the product container to verify the switch
    const productContainer = await page.locator('.products-list');
    const containerClass = await productContainer.getAttribute('class');

    if (!containerClass || !containerClass.includes('products-list')) {
        throw new Error('Product container did not switch to list view mode.');
    }

    return {
      success: true,
      action: "Switched product display to List View mode.",
      extractedData: {
        finalViewModeClass: containerClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of error, take a final screenshot for debugging
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to switch to List View mode.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
